import React from "react";
import "./App.css";
import { LoginPage } from "./Loginpage";
import { Grid } from "@material-ui/core";
import NavBar from "./NavBar";

function App() {
  return (
    <Grid container direction="columm">
      <Grid item>
        <NavBar></NavBar>
      </Grid>

        <LoginPage />

    </Grid>
  );
}

export default App;
